	function html( $group, $type, $icons )
	{
        var f, i, s, len, icon;
	    var h = '';
        var count = 0;
        if ( $group == "alpha")
        {
            for( i = 0, len = sites.length; i < len; i++ )
            {
                s = sites[i];
                icon = (s[$icons]) ? s[$icons] : (s[$icons.replace(/_dark/,"")] ? s[$icons.replace(/_dark/,"")] : s.icon);
                if ( s.alpha == '1' && s.status == 'active' && s[$type] == '1' )
                {
                    count++;
                    h += '<li style="padding-right: 5px; height: 22px;"><a style="height: 22px; line-height: 22px; display: inline-flex; " href="' + url( s.url ) + '" target="_blank"><img style="width: 22px; height: 22px; opacity:0.7;" onMouseover="this.style.opacity=1" onMouseout="this.style.opacity=0.7" src="' + icon + '" title="' + s.name + '"><\/a></li>';
                }
            }
            f = '<div id="portal648_Alpha" style="margin: 5px 0 5px 0; height: 22px;"><ul style="position: relative; list-style-type: none; display: inline-flex;">' + h + '</ul></div>';
        }

        else if ( $group == "beta" )
        {
            for( i = 0, len = sites.length; i < len; i++ )
            {
                s = sites[i];
                icon = (s[$icons]) ? s[$icons] : (s[$icons.replace(/_dark/,"")] ? s[$icons.replace(/_dark/,"")] : s.icon);
                if ( s.beta == '1' && s.status == 'active' && s[$type] == '1' )
                {
                    count++;
                    h += '<li style="padding: 0 5px 0 1px"><a style="height: 22px; line-height: 22px; z-index: 10; display: inline-flex; " href="' + url( s.url ) + '" target="_blank"><img style="width: 22px; height: 22px; opacity:0.7;" onMouseover="this.style.opacity=1" onMouseout="this.style.opacity=0.7" src="' + icon + '" title="' + s.name + '"><\/a></li>';
                }
            }
            f = '<ul id="portal648_Beta" style="list-style-type: none; margin: 8px 0px 5px 0; height: 22px; float: right; display: inline-flex;">' + h + '</ul>';
        }

        else if ( $group == "kisi" )
        {
            for( i = 0, len = sites.length; i < len; i++ )
            {
                s = sites[i];
                icon = (s[$icons]) ? s[$icons] : (s[$icons.replace(/_dark/,"")] ? s[$icons.replace(/_dark/,"")] : s.icon);
                if ( s.status == 'active' && s[$type] == '1' && s.alpha == '1' )
                {
                    count++;
                    h += '<li style="padding-right: 6px; height: 22px;"><a style="height: 22px; line-height: 22px; display: inline-flex; " href="' + url( s.url ) + '" target="_blank"><img style="width: 22px; height: 22px; opacity:0.7;" onMouseover="this.style.opacity=1" onMouseout="this.style.opacity=0.7" src="' + icon + '" title="' + s.name + '"><\/a></li>';
                }
            }
            f = '<div id="portal648_Kisi" style="margin: 9px 2px 0 0; height: 22px; float: right;"><ul style="position: relative; list-style-type: none; display: flex;">' + h + '</ul></div>';
        }

        return (count > 1) ? f : "";
	}


    function url( site )
	{
        var t = title;
        var tt = ttImdbId;
        var m = malId;
        var y = year;
        var ty = title_year;

        site = site
            .replace( /%title%/, t )
            .replace( /%imdbid%/, tt.replace( /tt|nm/, "" ) )
            .replace( /%ttimdbid%/, tt )
            .replace( /%malid%/, m )
            .replace( /%year%/, y )
            .replace( /%title_year%/, ty )
            .trim()
		;

        return site;
    }

